// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;
contract Certification{

    address owner;
    struct Lot {
        string code_magasin;
        string n_lot;
        string n_bon_livraison;
        uint256 poids;
        string date_arrivee;
        string provenance_fournisseur;
        string code_sanitaire;
        uint256 distance;
        bool circuit_proximite;
    }
    //la clé utilisé est le code_lot:concatination du code magasin + numéro de lot
    mapping (string => Lot) public lots;
    uint256 taille = 0;

    constructor(){
        owner = msg.sender;
    }
    modifier ownerOnly(){
         require(msg.sender == owner, "Owner only.");
         _;
     }
    modifier onlyContract{
        require(msg.sender == address(this), "Only Contract");
        _;
    }
    function ajouterLot(string memory _code_magasin,string memory _n_lot,string memory _n_bon_livraison,uint256 _poids,string memory _date_arrivee,string memory _provenance_fournisseur,string memory code_sanitaire,uint256 _distance) public{
        string memory code_lot = string(abi.encodePacked(_code_magasin, _n_lot));
        require(!exists(code_lot),"Le lot existe deja dans la blockchain");
        lots[code_lot]=Lot(_code_magasin,_n_lot,_n_bon_livraison,_poids,_date_arrivee,_provenance_fournisseur,code_sanitaire,_distance,false);
        taille ++;
        certification(code_lot);
    }
    function exists(string memory code_lot) public view returns(bool){
        return(lots[code_lot].distance > 0);
        }
    function getTaille()public view returns(uint256)
    {
        return taille;
    }
    function getCircuitProximite(string memory code_lot)public view returns(bool){
        return lots[code_lot].circuit_proximite;
    } 
    function getFournisseur(string memory code_lot)public view returns(string memory){
        return lots[code_lot].code_magasin;
    }
    function getDistance(string memory code_lot)public view returns(uint256){
        return lots[code_lot].distance;
    }
    function setCircuitProximite(string memory code_lot,bool c) public {
        lots[code_lot].circuit_proximite = c;
    }

    function getLotInformations(string memory code_lot) public view returns (string memory) {
        require(exists(code_lot),"Le Lot n'existe pas dans la blockchain");
        string memory res = string(abi.encodePacked("Code du magasin : " , lots[code_lot].code_magasin,"\n Numero Lot: " , lots[code_lot].n_lot,
                                                    "\n Code Lot: " , lots[code_lot].code_magasin,lots[code_lot].n_lot,"\n Numero du bon de livraison : ", 
                                                    lots[code_lot].n_bon_livraison,"\n Poids: " , toString(lots[code_lot].poids),"kg"
                                                    "\n Date d'arrivee du lot: " ,lots[code_lot].date_arrivee,"\n Provenance du Fournisseur : " ,
                                                    lots[code_lot].provenance_fournisseur,"\n Code sanitaire : " ,lots[code_lot].code_sanitaire,
                                                    "\n Distance: ", toString(lots[code_lot].distance),"km\n"));

        if (getCircuitProximite(code_lot)) {
            res = string(abi.encodePacked(res, "<b>C'est un produit qui provient d'un circuit de proximite</b>"));
        } else {
            res = string(abi.encodePacked(res, "<b>C'est un produit qui ne provient pas d'un circuit de proximite</b>"));
        }
        return res;
    
    }

    function toString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

    function certification(string memory code_lot) public{
        //require(getDistance(code_lot)<=uint256(80), "Il ne s'agit pas d'un circuit de proximite");
        if(getDistance(code_lot)<=uint256(80))
            setCircuitProximite(code_lot, true);
    }

}

